import React from 'react';
import contact from './contact.module.css'
import { Link } from "react-router-dom";
import image_why from '../../../assets/img/replace image.jpg'
import { Formik, Form, Field } from 'formik';

function validateEmail(value) {
	let error;
	if (!value) {
	  error = 'Required';
	} else if (!/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,4}$/i.test(value)) {
	  error = 'Invalid email address';
	}
	return error;
  }
  
  function validateUsername(value) {
	let error;
	if (value === 'admin') {
	  error = 'Nice try!';
	}
	return error;
  }

export const Contact = () => {
	return (
		<section className={contact.page__contact + ' ' + contact.contact} id={"form"}>
			<div className={contact.contact__container}>
				<h2 className={contact.conatct__title + " title"}>Contact us</h2>
				<form action="" className={contact.contact__form + " form"}>
					<input type="text" className={contact.form__control} placeholder="Email" />
					<input type="email" className={contact.form__control} placeholder="Name" />
					<input type="text" className={contact.form__control} placeholder="Subject" />
					<textarea className={contact.form__control} placeholder="Your message" />

					<input type="submit" className={contact.form__btn} value="Submit" />
				</form>
				<Formik
					initialValues={{
						username: 'ti',
						email: 't',
					}}
					onSubmit={values => {
						// same shape as initial values
						console.log(values);
					}}
				>
					{({ errors, touched, isValidating }) => (
						<Form>
							<Field name="email" validate={validateEmail} />
							{errors.email && touched.email && <div>{errors.email}</div>}

							<Field name="username" validate={validateUsername} />
							{errors.username && touched.username && <div>{errors.username}</div>}

							<button type="submit">Submit</button>
						</Form>
					)}
				</Formik>
			</div>
		</section>
	);
};
